import * as React from "react";
import gql from "graphql-tag";
import { useLazyQuery } from "@apollo/react-hooks";
// Style
import './CompanyDecks.styl'; 
// Icons
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { 
    faLock,
    faLockOpen,
    faShip,
    faExclamationTriangle,
} from '@fortawesome/free-solid-svg-icons'

// GQL
const DECKS_BY_COMPANY = gql`
  query getDecksByCompany($CompanyId: ID!, $PopulateInput:PopulateInput!) {
    getDecksByCompany(CompanyId:$CompanyId, PopulateInput:$PopulateInput) {
      _id
      name
      url
    }
  }
`;

//
// Function
//

const CompanyDecks: React.FunctionComponent<{}> = () => {
  // Set States
  const [activeCompanyId, setActiveCompanyId] = React.useState(null);

  // GraphQL - Q's
  const [ getDecks, 
    { 
      loading:decksLoading, 
      data:decksData, 
      error:decksError 
    }
  ] = useLazyQuery(DECKS_BY_COMPANY, { 
    fetchPolicy: "no-cache",
    errorPolicy: "all" 
  });

  //
  // Use Effect
  //


  React.useEffect(() => {
    // Set Active Company ID
    setActiveCompanyId("5ddd3993dae01149faf416ff")
    // Get Decks
    if(!decksData && activeCompanyId) {
        getDecks({ variables: {  
        CompanyId:activeCompanyId,
        PopulateInput: {
            key: "",
            skip: 0,
            limit: 2
        }
        }});                
    }

  },[activeCompanyId, setActiveCompanyId, decksData]);

  // Return
  return (
    <>
        { decksLoading && 
            <div className="company-decks-prompt">
                <div className="prompt-icon flash">
                    <FontAwesomeIcon icon={faShip}/>    
                </div>
            </div>
        }
        { decksError && 
            <div className="company-decks-prompt">
                <div className="prompt-icon flash">
                    <FontAwesomeIcon icon={faExclamationTriangle}/>    
                </div>
            </div>
        }
        <div className="company-decks">
            <div className="decks-list">
                <div className="list-search">
                    <input type="text" placeholder="Search 'Decks'"/>
                </div>
                {decksData && 
                    <>
                    {decksData.getDecksByCompany.length === 0 && <>No Decks</>}        
                    {decksData.getDecksByCompany.map((value, index) => {
                        return( 
                        <div className="list-deck" key={index}>
                            <div className="deck-avatar">{value.name[0]}</div>
                            <div className="deck-name">{value.name}</div>
                            <div className="deck-url">{value.url}</div>
                            <div className="deck-type">
                                <div className="type-icon"><FontAwesomeIcon icon={faLockOpen}/></div>
                                <div className="type-text">Public</div>
                            </div>
                        </div>
                        )
                    })}
                    </>
                } 
            </div>  
        </div>
    </>
  );
};

export default CompanyDecks
